COPY public.tipo_documentos (id, nome, descricao, created_at, updated_at, deleted_at, sigla) FROM stdin;
1	Ata	É o documento de valor jurídico, que consiste no resumo fiel dos fatos, ocorrências e decisões de sessões, reuniões ou assembléias, realizadas por comissões, conselhos, congregações, ou outras entidades semelhantes, de acordo com uma pauta, ou ordem-do-dia, previamente divulgada. É geralmente lavrada em livro próprio, autenticada, com as páginas rubricadas pela mesma autoridade que redige os termos de abertura e de encerramento.	2019-08-07 23:32:09	2019-08-07 23:32:09	\N	ATA
2	Autorização	Autorização é o ato administrativo ou particular que permite ao pretendente realizar atividades ou utilizar determinado bem fora das rotinas estabelecidas.	2019-08-07 23:32:09	2019-08-07 23:32:09	\N	AUT
3	Decreto	Ato administrativo destinado a prover situações gerais e individuais, abstratamente previstas de modo expresso, ou implícito na lei. São da competência exclusiva dos chefes do Executivo.	2019-08-07 23:32:09	2019-08-07 23:32:09	\N	DECR
4	Deliberação	É espécie do gênero ato administrativo normativo ou decisório praticado pelo órgão colegiado	2019-08-07 23:32:09	2019-08-07 23:32:09	\N	DEL
5	Declaração	Declaração é o documento de manifestação administrativa, declaratório da existência ou não de um direito ou de um fato.	2019-08-07 23:32:09	2019-08-07 23:32:09	\N	DECL
6	Edital	Instrumento pelo qual a Administração dá conhecimento ao público sobre: licitações,\n        concursos públicos, atos deliberativos etc.	2019-08-07 23:32:09	2019-08-07 23:32:09	\N	EDI
7	Instrução Normativa	Ato assinado por titular de órgão responsável por atividades sistêmicas, visando a orientar órgãos setoriais e seccionais, a fim de facilitar a tramitação de expedientes relacionados com o sistema e que estejam com instrução e resolução sob responsabilidade desses órgãos. Trata, também, da execução de leis, decretos e regulamentos.	2019-08-07 23:32:09	2019-08-07 23:32:09	\N	INS
8	Lei	É a ordem ou regra imposta à obediência de todos, pela autoridade competente.	2019-08-07 23:32:09	2019-08-07 23:32:09	\N	LEI
9	Parecer	Manifestação de órgãos especializados sobre assuntos submetidos à sua consideração; indica a solução, ou razões e fundamentos necessários à decisão a ser tomada pela autoridade competente. Pode ser enunciativo, opinativo ou normativo. Em se tratando de parecer emitido por colegiado, este somente surtirá efeitos se aprovado pelo plenário, caso em que deve ser explicitado\n        no documento.	2019-08-07 23:32:09	2019-08-07 23:32:09	\N	PAR
10	Portaria	Ato pelo qual as autoridades competentes (titulares de órgãos) determinam providências de caráter administrativo, visando a estabelecer normas de serviço e procedimentos para o(s) órgão(s), bem como definir situações funcionais e medidas de ordem disciplinar	2019-08-07 23:32:09	2019-08-07 23:32:09	\N	PORT
11	Relatório	É a exposição circunstanciada de atividades levadas a termo por funcionário, no desempenho das funções do cargo que exerce, ou por ordem de autoridade superior. É geralmente feito para expor: situações de serviço, resultados de exames, eventos ocorridos em relação a planejamento, prestação de contas ao término de um exercício etc.	2019-08-07 23:32:09	2019-08-07 23:32:09	\N	RES
12	Resolução	Ato assinado por Secretários de Estado e / ou titulares de Órgãos diretamente subordinados ao Governador do Estado, visando a instruir normas a serem observadas no âmbito da respectiva área de atuação.	2019-08-07 23:32:09	2019-08-07 23:32:09	\N	DES
